import React, { useEffect } from "react";
import Logo from "../components/Logo";
import axios from "axios";

const Cooking = () => {
  const getData = () => {
    axios
      .get("https://www.themealdb.com/api/json/v1/1/search.php?s=Arrabiata")
      .then((res) => console.log(res));
  };

  useEffect(() => {
    getData();
  }, []);

  return (
    <div>
      <Logo />
    </div>
  );
};

export default Cooking;
